async function dsc(_prompt) {
    const data = {
        prompt: _prompt
    };
    const res = await fetch("/api/prompt", {
        method: "POST",
        headers: {
            "Content-Type": "application/json"
        },
        body: JSON.stringify(data)
    });
    const response = await res.text();
    const obj = JSON.parse(response);
    return obj.response;
}
function parsePoints(text) {
    const strengths = [];
    const parts = text.split(/\d+\./).slice(1);
    for (const part of parts){
        const [title, ...descriptionParts] = part.split(":");
        const description = descriptionParts.join(":").trim();
        if (title && description) {
            strengths.push({
                title: title.trim(),
                description: description.replace(/\.$/, "")
            });
        }
    }
    return strengths;
}
function parseRisksAndMitigations(text) {
    const risks = [];
    const parts = text.split(/\d+\./).slice(1);
    for (const part of parts){
        const [title, ...descriptionParts] = part.split(":");
        const fullDescription = descriptionParts.join(":").trim();
        const [risk, mitigation] = fullDescription.split("Mitigation:");
        if (title && risk) {
            risks.push({
                title: title.trim(),
                description: `${risk.trim()}\nMitigation:${mitigation ? mitigation.trim() : "Not provided"}`
            });
        }
    }
    return risks;
}
